●草花の広がりを抑えて美しく演出できる!●ささえる茎の横すべりを抑えるスベリ止めデザイン!<br>草花の鉢植えや寄せ植え、花壇などでのレイアウトで、草花が横に広がって、徐々にダラ～んとした感じになるあの感じ。杭を挿したり、ヒモで引っぱったりと意外と苦労し、景観も損なわれますよね。そこでオススメなのが、カンタンに手で挿すだけで草花の広がりを抑え込むことができるこのセットです。上部の支え部分はアール形状で草花にピッタリ、しかも茎の横すべりを抑えるスベリ止めデザインなので、セットした草花のバランスを整えます。通常の高さには固定タイプで、また、背の高い草花には伸縮タイプを使ってアレンジしてください。ワンポイントのささえにも最適です。<br>●サイズ:固定タイプ/約幅14×長さ20.2cm 伸縮タイプ/約幅14×長さ最長32cm<br>●重量:固定タイプ/約9g 伸縮タイプ/約20g<br>●材質:ポリプロピレン<br>●耐熱温度:110℃<br>●セット内容:固定タイプ×18本、伸縮タイプ×4組<br>●生産国:日本<br>●パッケージサイズ:27×30×10cm 290g<br><br>[広告文責]有限会社ワイズギフト<br>【TEL】050-3736-2504<br><br><br><!--GoQSystemレビュー自動更新ツールワイド--><table align="center" width="650" border="0" cellpadding="0" cellspacing="0" bgcolor="#FFFFFF"><tr><td><table align="center" width="650" border="0" cellpadding="0" cellspacing="0" bgcolor="#FFFFFF"><tr><td align="center" valign="bottom" bgcolor="#cccccc"><img src="http://www.rakuten.ne.jp/gold/ssk-1/goqsystem_review/img/rev.jpg" width="650" id="rev_head" /></td></tr></table><table align="center" width="648" border="0" cellpadding="0" cellspacing="0" bgcolor="#CCCCCC" style="border-left:solid;border-left-width:1px;border-right:solid;border-right-width:1px;border-bottom:solid;border-bottom-width:1px;border-color:#CCCCCC;"><tr><td align="center" bgcolor="#FFFFFF"><div class="ifrm-container" style="width:648px;height:446px;overflow:auto;-webkit-overflow-scrolling:touch;"></div></td></tr></table></td></tr></table><!--GoQSystemレビュー自動更新ツールワイド--><br><STYLE TYPE="text/css"> 
